  input: TEXT,SB22,SB22.8396,"This entry was originally incorrectly stated to have
    been a disbursement to our COPE account.  I have corrected this to be a disbursement
    to our PAC account.This disbursement was made to correct an error.  In June 2003,
    a request was received for a $3,000 contribution made payable to the NYS AFL-CIO.  In
    error, this contribution was made from the NYS PEF PAC Fund, our non-federal committee
    account.  In order to correct this, and replace the funds, a check was then cut
    from the NYS PEF COPE Fund, our federal committee account, and deposited into
    the NYS PEF PAC Fund.  Both the deposit and the check were reported in our filings
    with the NYS Board of Elections and the IRS for the 12/31/03 year-end report.  In
    speaking with Jennifer Jones, our Campaign Finance Analyst, I now understand that
    this is not the correct action that should have been taken.  Ms. Jones explained
    that in the future, if errors like this our made, a refund should be requested
    from the committee the contribution was made to, that should be deposited in the
    appropriate account (the PAC in this case) and then a check should be cut from
    the correct account (the COPE in this case) to the committee directly.  I apologize
    for this error and the misunderstanding on my part that as long as the funds were
    replaced, this procedure would be acceptable.  Thank you, Valerie S. O'Dell"
